import React, { Component } from "react";

class Wahlkreiserst extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <h2 id="Wahlkreisubersicht_erst">Wahlkreisubersicht (Einzelstimmen)</h2>
        <p>Select the WahlKreis</p>
        <div id="group"></div>

        <h3>Wahlbeteiligung</h3>
        <div id="Wahlbeteiligung7">
          <p id="wahlbet7"></p>
        </div>
        <h3>Direktkandidaten</h3>
        <div id="Direktkandidaten_info7">
          <p id="direktkand7"></p>
        </div>

        <h3>Pro Partei, entwicklung</h3>
        <div id="partei_entw7">
          <table id="p_entw7"></table>
        </div>
      </React.Fragment>
    );
  }
}

export default Wahlkreiserst;
